      config: '.jsbeautifyrc',
      mode: 'VERIFY_AND_WRITE'
    }))
    .pipe(dest(config.jsSetting.dist))

export const cloneFontFolder = () =>
    src(config.fontsSetting.src)
    .pipe(newer(config.fontsSetting.dist))
    .pipe(dest(config.fontsSetting.dist))

