    src([
      `${config.dir.dist}**/*`,
      `./.gitlab-ci.yml`,
    ])
    .pipe(ghPages({
      branch: 'master',
      message: deployMessage() ? `[DEPLOY]${deployMessage()}` : `[DEPLOY]${info.commitMessage}`
    }))

